import { firstName } from './Parent'
function InChild({ data }) {
    // console.log(data.arr);

    const submitForm =(event)=>{
        event.preventDefault
    }
    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>age</th>
                    </tr>
                </thead>
               <tbody>
               {data.arr.map((item, i) => {
                    return <tr key={i}>
                        <td>{item.name}</td>
                        <td>{item.age}</td>
                    </tr>
                })}
               </tbody>
            </table>


            <form onSubmit={submitForm}>
                <input name='name' placeholder='name' />
                <input age= 'age' placeholder='age' />
                <button>Add</button>
            </form>

        </>
    )
}
export default InChild
